import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Home from '../views/home/home';
import Cadastro from '../views/cadastro/cadastro';
import Login from '../views/login/login';
import EsqSenha from '../views/esqsenha/esqsenha';
import CodConfirm from "../views/cadastro/codconfirmacao";
import CadastroConsole from "../views/cadastro/console";
import DadosUser from "../views/cadastro/dadosuser";
import TermosCadastro from "../views/cadastro/termos";
import NovaSenhaDoUsuario from "../views/esqsenha/novasenha";
import CodigoConfirmacaoRecSenha from "../views/esqsenha/codconfirmrecsenha";
import SobreStars from '../views/sobreStars/sobreStars';
import Contato from '../views/contato/contato';
import Regras from '../views/regras/regras';
import Historico from '../views/historico/historico';
// import HistoricoCompras from '../views/historico/historicocompras';
import Perfil from '../views/perfil/perfiluser';
import EditarPerfil from '../views/perfil/editarperfil';
import ComoJogar from '../views/como/comofunciona';
import Ranking from '../views/ranking/ranking';
import ConverterStars from "../views/converstars/converterstars";
import Erro from '../views/Error';
import Logout from "../views/Logout";


const Routes = () => (
    <BrowserRouter>
        <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/login" component={Login} />
            <Route path="/cadastro" component={Cadastro} />
            <Route path="/codconfirmacao" component={CodConfirm} />
            <Route path="/console" component={CadastroConsole} />
            <Route path="/dadosuser" component={DadosUser} />
            <Route path="/termos" component={TermosCadastro} />
            <Route path="/novasenha" component={NovaSenhaDoUsuario} />
            <Route path="/esqsenha" component={EsqSenha} />
            <Route path="/codigoconfirmacaorecsenha" component={CodigoConfirmacaoRecSenha} />
            <Route path="/sobrestars" component={SobreStars} />
            <Route path="/contato" component={Contato} />
            <Route path="/regras" component={Regras} />
            <Route path="/historico" component={Historico} />
            {/* <Route path="/historicocompras" component={HistoricoCompras} /> */}
            <Route path="/perfil" component={Perfil} />
            <Route path="/editarperfil" component={EditarPerfil} />
            <Route path="/comojogar" component={ComoJogar} />
            <Route path="/ranking" component={Ranking} />
            <Route path="/converterstars" component={ConverterStars} />
            <Route path="/error" component={Erro} />
            <Route path="/logout" component={Logout} />
        </Switch>
    </BrowserRouter>
);

export default Routes;
